In my implementation, if an array is passed for children, and any of the children are a function, that will throw away all children, except for the function
I understand that there is an API freeze, but this is not breaking any existing APIs, only adding on.
Please feel free to reject this specific PR, although if you do, I think this is worthwhile feature to consider.

According to the doc, $refs is a dictionary of Vue instance or Element. This pull request reflect this by a union type. So users can declare html elements in $refs.
A test is also added. User defined components may have better knowledge about $refs' data structure. So users can also reify special properties to more specific types.
