ES6 const does not indicate that a value is ‚Äòconstant‚Äô or immutable. A const value can change. Instead, it is the binding that is fixed, or constant.
The following is perfectly valid ES6 code that does not throw an exception:
const foo = {};
foo.bar = 42;
console.log(foo.bar);
// ‚Üí 42
